import { useState } from "react"
import { MainWrapper } from "./DetailMessages.styles"

const DetailMessages = (props: any) => {

    const [messages, setMessage] = useState([
        'Привет, как твои дела?',
        'Да вроде неплохо, а твои?',
        'Да вот делаю бэк',
        'Сочувствую'
    ])

    return(
        <MainWrapper key={props.message.id}>
            <h1>Подробные сообщения</h1>
        </MainWrapper>
    )    
}

export default DetailMessages
